import React from 'react'
import TextField from '@mui/material/TextField';
import '../App.css';
import Button from '@mui/material/Button';

export default function AddData({closeAddModal}) {
  return (
    <div className='modalBackground'>
    <div className='modalContainer'>
      <TextField id="demo-helper-text-misaligned-no-helper" label="Title" />
      <br></br>
      <br></br>
      <TextField id="demo-helper-text-misaligned-no-helper" label="Description" />
      <br></br>
      <div className='buttons'>
        <Button variant="contained" color="inherit">Add</Button>
        <Button variant="outlined" color="inherit" onClick={() => closeAddModal(false)}>Cancel</Button>
      </div>
    </div>
    </div>
  )
}
